window.addEventListener("load",(function(){if(0<invp_google_maps_v3.locations.length){for(var map=new google.maps.Map(document.getElementById("map_canvas"),{zoom:13,center:new google.maps.LatLng(39.833333,-98.583333),mapTypeId:google.maps.MapTypeId.ROADMAP}),bounds=new google.maps.LatLngBounds,l=0;l<invp_google_maps_v3.locations.length;l++)if(null!=invp_google_maps_v3.locations[l].coords){var marker=new google.maps.Marker({position:new google.maps.LatLng(invp_google_maps_v3.locations[l].coords.lat,invp_google_maps_v3.locations[l].coords.lon),map:map,title:invp_google_maps_v3.locations[l].name});bounds.extend(marker.position);var infoWindow=new google.maps.InfoWindow({content:'<div class="mapBubble" style="color: #000;"><b>'+invp_google_maps_v3.locations[l].name+"</b><br />"+invp_google_maps_v3.locations[l].address+"</div>",disableAutoPan:!1,anchor:marker});with({thisMarker:marker,thisInfoWindow:infoWindow})google.maps.event.addListener(thisMarker,"click",(function(){thisInfoWindow.open(map,thisMarker)}))}map.fitBounds(bounds)}}));